import React from 'react';
import {Route, Switch} from "react-router";

import Github from '../github/Github.js';
import Counter from "../Counter/Counter.js"
export default () => (
    <Switch>
        <Route exact path="/">
            <h1>Home</h1>
        </Route>
        <Route path="/github">
            <Github />
        </Route>
    </Switch>
)
